import { Toolbar,AppBar,Typography } from '@material-ui/core';

const headerStyle = {
  padding: 20,
};
const imgStyle = {
  width:'100px',
  heigth:'100px'
}
const Header = () => (

  <AppBar style={headerStyle} position="static">
    <Toolbar>
      <Typography variant="h6" >

        <img style={imgStyle} src={'/images/1.jpg'}/>
      </Typography>
    </Toolbar>
  </AppBar>
);

export default Header;
